import React from 'react';
import { StyleSheet, Text, View, Image } from 'react-native';
import {Card} from 'react-native-paper';

const  Home=()=>{
return(
    <Card style={styles.mycard}>
        <view style={styles.cardView}>
        <Image 
        style={{width:60,height:60, borderRadius:50/2}}     //rounded img
        source ={{uri:"https://play-lh.googleusercontent.com/a-/AOh14GjGOVc8jPEdbWsyPQcy8N2vVMQrr8QT97f16bA"}}
        />
        <view style={{marginLeft:10}}>
          <Text style={styles.text}>Hello from home</Text>  
          <Text style={styles.text}>Web developer</Text>  
        </view>
        </view>
       
    </Card>
)
}

const styles = StyleSheet.create({
    mycard:{
        margin:5,
        padding:5,
        
    },
    cardView:{
        flexDirection:"row",
        padding: 6
    },
    text:{
        fontSize:20,
        marginLeft:10,
    }
})
export {Home}
